import React from 'react';

class Login extends React.Component {
    constructor(props) {
        super(props);

    }
    render() {
        return(
            <div className="container">
                <div className="row">
                    <h1 className="align-content-center">Login</h1>
                </div>
            </div>
        );
    }
}

export default Login;
